import { Card, Grid, Typography, } from '@material-ui/core'
import { ToggleButton } from '@material-ui/lab'
import DayIcon from '@material-ui/icons/WbSunnyTwoTone'
import NightIcon from '@material-ui/icons/NightsStayTwoTone'
import { useState } from 'react'

const AvailabilityComponent = () => {
    const [mondayMorning, setMondayMorning] = useState(true)
    const [mondayEvening, setMondayEvening] = useState(true)
    const [tuesdayMorning, setTuesdayMorning] = useState(true)
    const [wednesdayMorning, setWednesdayMorning] = useState(true)
    const [thursdayMorning, setThursdayMorning] = useState(true)
    const [fridayMorning, setFridayMorning] = useState(true)
    const [saturdayMorning, setSaturdayMorning] = useState(true)
    const [sundayMorning, setSundayMorning] = useState(true)

    return (
        <Card style={{minWidth:500}}> 
            <Grid container justify="center" direction="column" align="center" xs={12} >
                <Typography>Availability</Typography>

                <Grid item container justify="space-around" direction="row" >

                    <Grid item container direction="column" justify="center" align="center" xs={1}>
                        <Typography>Mon</Typography>
                        <ToggleButton
                            value="check"
                            selected={mondayMorning}
                            size="small"
                            onChange={() => {
                                setMondayMorning(!mondayMorning);
                            }}
                        >
                            <DayIcon />
                        </ToggleButton>

                        <ToggleButton
                            value="check"
                            selected={mondayEvening}
                            size="small"
                            onChange={() => {
                                setMondayEvening(!mondayEvening);
                            }}
                        >
                            <NightIcon />
                        </ToggleButton>
                    </Grid>

                </Grid>
            </Grid>
        </Card>
    )
}

export default AvailabilityComponent
